INSERT INTO `product` (`id`, `product_page_link_id`, `shop_id`, `title`, `price`, `description`, `image`, `date_added`, `token`, `currency_id`) VALUES
(1, 1, 1, 'Shmutke wind Lycra', 29.95, 'BUY THIS AWESOME LYCRA.', 'http://www.surfhouse.lt/eshop/image/cache/data/products/gaastra/2016/clip_image003-600x800.jpg', '2016-05-04 19:54:16', 'shmutke-wind-lycra', 1),
(2, 2, 1, 'Shmutke one piece onesie green', 79.95, 'Shmutke WC13 Gray\r\n\r\n100% Cotton. Made in EU. Made for everyday wearing and keeps you warm all the time. Best for all kind of travelling except diving.\r\n \r\n\r\n\r\n\r\nSize  \r\n			Chest  \r\n			Waist  \r\n			Hips  \r\n			Sleeves \r\n			Length \r\n		XS\r\n			100\r\n			94\r\n			110\r\n			64\r\n			150-160\r\n		S\r\n			104\r\n			98\r\n			116\r\n			67\r\n			155-169\r\n		M\r\n			112\r\n			104\r\n			110\r\n			68\r\n			165-180\r\n		L\r\n			120\r\n			108\r\n			116\r\n			68\r\n			180-195\r\n		Xl\r\n			124\r\n			114\r\n			120\r\n			68\r\n			185-195\r\n		XXL\r\n			130\r\n			120\r\n			126\r', 'http://www.surfhouse.lt/eshop/image/cache/data/products/shmutke/shmutke green-600x800.jpeg', '2016-05-04 19:54:26', 'Shmutke-one-piece-onesie-green', 1),
(3, 3, 1, 'Roxy Surf School 5/4/3 Black wetsuit', 159.95, 'Whole body Wetsuit by Roxy. The Surf School Steamer is a great neoprene suit. Back zip.', 'http://www.surfhouse.lt/eshop/image/cache/data/products/roxy/older/Surf+School+3+2MM+L+SL+Steamer+Wetsuit-600x800.jpg', '2016-05-05 22:36:27', 'roxy-surf-school-5-4-3-black-wetsuit', 1),
(4, 4, 1, 'Roxy Rip Tide Spring wetsuit', 139.95, 'Sport your girly style while you ride the waves in this floral printed Rip Tide Spring Suit.\r\n\r\nFeatures\r\n\r\nLong sleeve spring suit.\r\n	Contrasting floral printed panels at front and under arms.\r\n	High neckline.\r\n	Back zip design.\r\n	Back zippered pocket for secure storage.\r\n	Thumbholes on sleeves for extra comfort.\r\n \r\n\r\nDetails\r\n\r\n92% Nylon/Polyamide, 8% Elastane Hyperstretch.\r\n	2mm Neoprene.\r\n	UPF 50+ protection.', 'http://www.surfhouse.lt/eshop/image/cache/data/products/roxy/older/arjw403002_riptidespringsuit,v_wbb7_frt1-600x800.jpg', '2016-05-05 22:36:40', 'roxy-rip-tide-spring-wetsuit', 1),
(5, 5, 1, 'Quiksilver Syncro 3/2mm wetsuit SA302MG BBL BLUE M', 149.95, 'Features:\r\n\r\n100% Hyperstretch II Neoprene\r\n	Vaporstretch mesh chest panel\r\n	Hydrowrap neck closure\r\n	Flatlock seams\r\n	YKK standard length back zip\r\n	Ectoflex knee pads\r\n	 ', 'http://www.surfhouse.lt/eshop/image/cache/data/products/quiksilver/older/sa402mg_blue_8-600x800.png', '2016-05-05 22:36:53', 'quiksilver-syncro-3-2mm-wetsuit-sa302mg-bbl-blue-m', 1),
(6, 6, 1, 'Quiksilver Syncro 2/2mm wetsuit SA217MF BKW Black', 149.95, 'Features:\r\n\r\n100% Hyperstretch II Neoprene\r\n	Vaporstretch mesh chest panel\r\n	Hydrowrap neck closure\r\n	Flatlock seams\r\n	YKK standard length back zip\r\n	Ectoflex knee pads\r\n	 ', 'http://www.surfhouse.lt/eshop/image/cache/data/products/quiksilver/older/sa217mf-600x800.png', '2016-05-05 22:37:05', 'quiksilver-syncro-2-2mm-wetsuit-sa217mf-bkw-black', 1),
(7, 7, 1, 'Quiksilver Surfschool 5/4/3mm wetsuit SS504MG BKW Black', 159.95, 'The Cypher has been improved with the addition of Dryoprene, a combo of FN Lite Neoprene and Recycled Poly Infused with CoConut Charcoal making it the warmest, fastest drying thermal lining to date. Combined with Hydrolock Seam Seals, a water-block semi dry zipper and flush lock seals on the wrists and ankles, the Cypher will certainly keep you warm in the line up.\r\n\r\nDetails\r\n\r\nThickness: 5/4/3mm\r\n\r\nNeoprene: FN Lite Neoprene\r\n\r\nSeams: Hydrolock Seam Seals\r\n\r\nZipper: Chest Zip\r\n\r\n \r\n\r\nProduct F', 'http://www.surfhouse.lt/eshop/image/cache/data/products/quiksilver/older/Surf+School+3+2MM+L+SL+Steamer+Wetsuit-600x800.jpg', '2016-05-05 22:37:16', 'quiksilver-surfschool-5-4-3mm-wetsuit-ss504mg-bkw-black', 1),
(8, 864, 2, '2013 CrazyFly Sculp 10m2', 500, '2013 CrazyFly Sculp jėgos aitvaras. Pilnas komplektas su pompa, lyšu, baru, kuprine. Būklė labai gera. Šiuo metu yra Vilniaus parduotuvėje.', 'http://www.xpro.lt/471-tm_thickbox_default/2010-cabrinha-switchblade-12m2.jpg', '2016-05-05 22:37:23', '222-2010-cabrinha-switchblade-12m2', 1),
(9, 865, 2, '2015 Prolimit FX', 139, 'FX trapecija yra gavusi puikų pirkėjų įvertinimą ir pasitikėjimą. Aukšta nugaros atrama ir žema šonų atrama leidžia labai komfortiškai jaustis įprastoje kaitavimo pozicijoje.', 'http://www.xpro.lt/120-tm_thickbox_default/prolimit-fx.jpg', '2016-05-05 22:37:30', '32-prolimit-fx', 1),
(10, 866, 2, '2016 Cabrinha  1x with Trimlite', 404, 'Cabrinha komandai pelnytai didžiuojasi savo valdymo sistema, kuri išsiskiria  išbaigtumu, kokybe, saugumu. Nereguliujamo ilgio, maksimaliai išlengvinta. Daugiau informacijos galite rasti gamintojų tinKLAPYje.', 'http://www.xpro.lt/1159-tm_thickbox_default/2016-cabrinha-overdrive1x-with-recoil.jpg', '2016-05-05 22:37:35', '589-2016-cabrinha-overdrive1x-with-recoil', 1),
(11, 867, 2, '2016 Cabrinha Chaos', 1, '2015 Pasaulio taurės antros vietos laimėtojas freestyle rungtyje. Jeigu jūs treniruojatės freestyle  triukus tai šis kaitas jums. Greitas, tikslus, puikiai dirba unhook režime. Tik su juo jūs atliksite savo tobulą kiteloopą. Daugiau informacijos apie šį sportišką ir agresyvų aparatą rasite gamintojų tinklapyje. \r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa parduodami atskirai.', 'http://www.xpro.lt/910-tm_thickbox_default/2015-cabrinha-chaos.jpg', '2016-05-05 22:37:40', '135-2015-cabrinha-chaos', 1),
(12, 868, 2, '2016 Cabrinha Contra', 1, 'Šis mažo vėjo aitvaras leis jums  mėgautis kaitavimu kai vėjo greitis tik 3,5-7m/s. \r\n \r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa parduodami atskirai.\r\n \r\nDaugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/915-tm_thickbox_default/2015-cabrinha-contra.jpg', '2016-05-05 22:37:46', '133-2015-cabrinha-contra', 1),
(13, 869, 2, '2016 Cabrinha Drifter', 1, 'Jau tris metus iš eilės 2012, 2013 ir 2014 su Cabrinha Drifter laimima pasaulio taurė surf rungtyje. Turbūt todėl šis aitvaras tituluojamas kaip geriausias pasaulyje surf kaitas. Jis suprojektuotas bangoms ir bangose atlieka savo darbą idealiai. Akimirksniu reaguoja kai jums reikia aitvaro jėgos ir ramiai leidžia jums mėgautis ir žaisti su  banga sekdamas jus viršuje bei laukdamas komandos. Daugiau informacijos rasite gamintojų tinklapyje.\r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa pa', 'http://www.xpro.lt/912-tm_thickbox_default/2015-cabrinha-drifter.jpg', '2016-05-05 22:37:52', '134-2015-cabrinha-drifter', 1),
(14, 870, 2, '2016 Cabrinha FX', 1, 'Tai naujas Cabrinha kaitas. Jis jums patiks dėl aukštų šuolių, greitumo, tikslumo. Šis aitvaras tai auksinis viduriukas tarp Chaos ir Switchblade modelių.  Daugiau informacijos galite rasti gamintojų tinklapyje. \r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa parduodami atskirai.\r\n.', 'http://www.xpro.lt/908-tm_thickbox_default/2015-cabrinha-radar.jpg', '2016-05-05 22:37:57', '273-2015-cabrinha-radar', 1),
(15, 871, 2, '2016 Cabrinha Genesis 2m2', 386, 'Mokomasis  aitvaras, skirtas suprasti ir išmokti valdymą prieš pradedant naudotis didesniais aitvarais.  Kaitas parduodamas be valdymo baro. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/921-tm_thickbox_default/2015-cabrinha-contra.jpg', '2016-05-05 22:38:02', '318-2015-cabrinha-contra', 1),
(16, 872, 2, '2016 Cabrinha Overdrive1x with recoil', 494, 'Cabrinha komandai pelnytai didžiuojasi savo valdymo sistema, kuri išsiskiria  išbaigtumu, kokybe, saugumu. Reguliuojamo ilgio vairalazdė (baras). Standartinio dydžio ( 48-56cm), XL dydžio (57-65cm). Daugiau informacijos galite rasti gamintojų tinklapyje.', 'http://www.xpro.lt/1150-tm_thickbox_default/2016-cabrinha-overdrive1x-with-recoil.jpg', '2016-05-05 22:38:07', '587-2016-cabrinha-overdrive1x-with-recoil', 1),
(17, 873, 2, '2016 Cabrinha Overdrive1x with Trimlite', 449, 'Cabrinha komandai pelnytai didžiuojasi savo valdymo sistema, kuri išsiskiria  išbaigtumu, kokybe, saugumu. Reguliuojamo ilgio vairalazdė (baras)( 48-56cm). Daugiau informacijos galite rasti gamintojų tinKLAPYje.', 'http://www.xpro.lt/1154-tm_thickbox_default/2016-cabrinha-overdrive1x-with-recoil.jpg', '2016-05-05 22:38:12', '588-2016-cabrinha-overdrive1x-with-recoil', 1),
(18, 874, 2, '2016 Cabrinha Radar', 788, 'Sukurtas maksimaliai greitam jusų kaitavimo įgūdžių progresui. Labai lengvas ir greičiausiai iš vandens kylantis aitvaras. Nepaprastai lengvai ir tiksliai vykdantis jūsų komandas. Daugiau informacijos galite rasti gamintojų tinklapyje. \r\n \r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa parduodami atskirai.', 'http://www.xpro.lt/901-tm_thickbox_default/2015-cabrinha-radar.jpg', '2016-05-05 22:38:17', '132-2015-cabrinha-radar', 1),
(19, 875, 2, '2016 Cabrinha Spark 2,6m2', 287, 'Mokomasis  aitvaras, skirtas suprasti ir išmokti valdymą prieš pradedant naudotis didesniais aitvarais.  Daugiau informacijos rasitaldymo baroe gamintojų tinklapyje.', 'http://www.xpro.lt/922-tm_thickbox_default/2015-cabrinha-contra.jpg', '2016-05-05 22:38:22', '464-2015-cabrinha-contra', 1),
(20, 876, 2, '2016 Cabrinha Switchblade ', 1, 'Tai pats populiariausias Cabrinha modelis, kuris jau dešimt metų dominuoja freeride/wakestyle kategorijoje. Pamėgtas kaituotuojų dėl savo geros traukos, stabilumo, tikslumo,  labai plataus  vėjo diapazono, aukštų šuolių, išskirtinio dizaino ir pagaminimo kokybės. Valdyti šį aitvarą ir vienas malonumas.\r\n \r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa parduodami atskirai.\r\n \r\nDaugiau informacijos galite rasti gamintojų tinklapyje.', 'http://www.xpro.lt/898-tm_thickbox_default/2015-cabrinha-switchblade.jpg', '2016-05-05 22:38:28', '130-2015-cabrinha-switchblade', 1),
(21, 877, 2, '2016 Cabrinha Velocity', 1, '2012 ir 2013  Pasaulio taurės laimėtojas race disciplinoje. Rimčiausia greičio mašina. Išlengvinta konstrukcija, neįtikėtinai platus vėjo diapazonas,  pati didžiausia galia kiekviename šio aitvaro kvadratiniame metre. Daugiau informacijos galite rasti gamintojų tinklapyje.\r\nKaina - aitvaro su kuprine. Valdymo sistema ir pompa parduodami atskirai.', 'http://www.xpro.lt/919-tm_thickbox_default/2015-cabrinha-velocity.jpg', '2016-05-05 22:38:34', '136-2015-cabrinha-velocity', 1),
(22, 878, 2, '2016 Crazy Fly Sculp', 1, 'Viskas ko jums reikia kaitavimui - tai Sculp aitvaras išsiskiriantis savo universalumu. Tinkamas labai plačiam sąlygų ir kaituotojų diapazonui. Dėl savo delta formos jis turi tiesioginį valdymo jausmą, greitai reaguoja į jūsų komandas ir yra stabilus bei tikslus ore. Neįtikėtinas lengvumo jausmas jaučiamas  valdant šį aitvarą.  Aukščiausios kokybės medžiagos iš Vokietijos ir Japonijos naudojamos gaminant šiuos aitvarus. Visa gamyba vykdoma naujutėliame Crazy Fly fabrike. \r\nAitvaras yra pilnai su', 'http://www.xpro.lt/928-tm_thickbox_default/2015-crazy-fly-sculp.jpg', '2016-05-05 22:38:44', '127-2015-crazy-fly-sculp', 1),
(23, 879, 2, '2016 CrazyFly  ATV', 659, 'Universaliausia surf lenta CrazyFly asortimente. Su vidutinio dydžio dugno įlinkiu ši lenta anksti išglisuoja ir turi didelį pagreitį. Ją labai lengva kontroliuoti, net ir dideliame greityje. Jeigu jūs ruošiatės treniruotis kaitavimą bangose, tai būtų geriausias pasirinkimas. Daugiau informacijos apie šį žaislą rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1173-tm_thickbox_default/2015-crazyfly-atv.jpg', '2016-05-05 22:38:49', '152-2015-crazyfly-atv', 1),
(24, 880, 2, '2016 CrazyFly  Classic', 659, 'Suprojektuota kaituoti didelėse, greitose, galingose bangose. Ši lenta turi tvirčiauią konstrukciją, kad išgyventų rūščiose sąlygose. Daugiau informacijos apie šį žaislą rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1175-tm_thickbox_default/2015-crazyfly-atv.jpg', '2016-05-05 22:38:55', '154-2015-crazyfly-atv', 1),
(25, 881, 2, '2016 CrazyFly  Strapless', 659, 'Sukurta mokintis ir tobulinti naujos kartos freestyle triukus be kojakilpių  bangose. Lengviausia ir daugiausia tūrio turinti lenta ir tai ją padaro tobulą šuoliuse be kilpų. Daugiau informacijos apie šį žaislą rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1174-tm_thickbox_default/2015-crazyfly-atv.jpg', '2016-05-05 22:39:05', '153-2015-crazyfly-atv', 1),
(26, 882, 2, '2016 CrazyFly Addict', 799, 'Lenta skirta pažengusiems kaituotojams, norintiems praplesti savo galimybių ribas. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1169-tm_thickbox_default/2015-crazyfly-nuke.jpg', '2016-05-05 22:39:13', '148-2015-crazyfly-nuke', 1),
(27, 883, 2, '2016 CrazyFly Allround', 499, 'Puikus kainos kokybės santykis, lengvas ir komfortiškas plaukimas, gražus dizainas. Neįtikėtinai komfortiška minkšta lenta su kuria galima labai aštriai pjautis į vėją. Skirta pradinukams ir vidutinio lygio kaituotuojams. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1167-tm_thickbox_default/2015-crazyfly-allround.jpg', '2016-05-05 22:39:18', '145-2015-crazyfly-allround', 1),
(28, 884, 2, '2016 CrazyFly Bulldozer', 649, 'Po sėkmingų 2015 metų ir 2016 Bulldozer lenta išlaiko savo stilių  freestyle/wakestyle/crossover ir pagrindines savybes. T.y. keturi išlenkimai išilginėje plokštumoje, konstrukcijoje naudojamas kevlaro pluoštas, unikalios kojakilpės reguliuojamos dvejais diržais, taip pat prie lentos galima prisukti wakeboard apkaustus arba batus ir naudoti ją wakeparke. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1165-tm_thickbox_default/2015-crazyfly-bulldozer.jpg', '2016-05-05 22:39:26', '140-2015-crazyfly-bulldozer', 1),
(29, 885, 2, '2016 CrazyFly Cruizer ', 699, 'Lengvo vėjo mašina. Sukurta, kad galėtumėte mėgautis kaitavimu pučiant ir nestipriems vėjams. Lengva konstrukcija su panaudotu anglies pluoštu, vidutinis lankstumas, puikios plaukimo savybės. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1170-tm_thickbox_default/2015-crazyfly-cruizer-pro.jpg', '2016-05-05 22:39:31', '149-2015-crazyfly-cruizer-pro', 1),
(30, 886, 2, '2016 CrazyFly Cruizer LW', 649, 'Lengvo vėjo mašina. Sukurta, kad galėtumėte mėgautis kaitavimu pučiant ir nestipriems vėjams. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1171-tm_thickbox_default/2015-crazyfly-cruizer-pro.jpg', '2016-05-05 22:39:37', '150-2015-crazyfly-cruizer-pro', 1),
(31, 887, 2, '2016 CrazyFly Girls', 649, 'Sukurta ir pagaminta merginoms. Puikiai subalansuotas lentos lankstumas. Lenta skirta vidutinio lygio arba pažengusioms kaituotojoms. Kojakilpės komplektuojamos mažesnio dydžio. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1168-tm_thickbox_default/2015-crazyfly-girls.jpg', '2016-05-05 22:39:43', '146-2015-crazyfly-girls', 1),
(32, 888, 2, '2016 CrazyFly Raptor', 699, 'Perkamiausia CrazyFly kaitlentė. Šis modelis gaminamas jau dešimtus metus. Medžio šedies ir anglies pluošto derinys su vienu išlenkimu per lentos išilginę ašį suteikia puikias plaukimo savybes. Tai viena universaliausių kaitlenčių, kurios kokybės kainos santykis tiesiog nerealus.  Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1164-tm_thickbox_default/2015-crazyfly-raptor-pro.jpg', '2016-05-05 22:39:48', '139-2015-crazyfly-raptor-pro', 1),
(33, 889, 2, '2016 CrazyFly Raptor  LTD', 819, 'Dvigubas dugno išlenkimas suteikia labai gerą kontrolę posūkiuose, nusileidimuosie po šuolių bei gerą kilimo į vėją kampą. Lenta dėl konstrukcijoje panaudoto anglies pluošto yra labai lengva. Ši lenta tapo labai populiari dėl savo kokybės, panaudojimo  universalumo, puikių charakteristikų ir elegantiškos išvaizdos. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1163-tm_thickbox_default/2015-crazyfly-raptor-pro-ltd.jpg', '2016-05-05 22:39:53', '138-2015-crazyfly-raptor-pro-ltd', 1),
(34, 890, 2, '2016 CrazyFly Shox Green', 649, 'Shox Green yra totali užsipjovimo į vėją mašina ir pati komfortiškiausia kaitlentė CrazyFly asortimente. Tuo pačiu tai pati ekologiškiausia lenta, kurios gamyba išsiskiria siekiant aukščiausių ekologijos standartų. Vidutinio standumo, su dvigubu dugno išlenkimu ir specialiai atrinkta mediena ši lenta puikiai absorbuoja vandens nelygumus. Sukurta vidutinio lygio ir pažengusiems kaituotuojams. Daugiau informacijos galite rasti gamintojų tinklapyje.', 'http://www.xpro.lt/1166-tm_thickbox_default/2015-crazyfly-shox-custom.jpg', '2016-05-05 22:39:58', '144-2015-crazyfly-shox-custom', 1),
(35, 891, 2, '2016 CrazyFly Skim', 349, 'Puikus žaislas lengvam vėjui arba nedidelėms bangoms.  Galima naudoti tiek su kyliukais, tiek be kyliukų. Lenta naudojama be kojakilpių, todėl bus magu atrasti naujas stovėsenas ir naujus triukus. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1172-tm_thickbox_default/2015-crazyfly-skim.jpg', '2016-05-05 22:40:03', '151-2015-crazyfly-skim', 1),
