(46, 902, 2, '2016 Prolimit Golf Aero Wheeled', 130, 'Pagamintas iš tvirto 600D poliesterio medžiagos. Su fiksuota ratukų platforma.  Talpina savyke 2-3 jėgos aitvarus ir kaitlentę. Nuimama ratukų bazė.  Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1193-tm_thickbox_default/prolimit-kitesurf-golf-aero-wheeled.jpg', '2016-05-05 22:41:08', '195-prolimit-kitesurf-golf-aero-wheeled', 1),
(47, 903, 2, '2016 Prolimit Golf LTD Wheeled', 150, 'Pagamintas iš tvirto 600D poliesterio medžiagos.  Su fiksuota ratukų platforma.  Talpina savyke 2-3 jėgos aitvarus ir kaitlentę. Integruoti vidiniai diržai suspaudimui. Patogos pakavimas, turi dvi perskirtas erdves.  Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1194-tm_thickbox_default/prolimit-kitesurf-golf-aero-wheeled.jpg', '2016-05-05 22:41:13', '196-prolimit-kitesurf-golf-aero-wheeled', 1),
(48, 904, 2, '2016 Prolimit Kitesurf Golf Ultralight', 70, 'Ypatingai lengvas kelioninis kaitavimo įrangos krepšys. Pagamintas iš tvirto 600D poliesterio medžiagos.   Kompaktiškas, talpina savyke 2-3 jėgos aitvarus ir kaitlentę.  Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1192-tm_thickbox_default/prolimit-kitesurf-golf-aero-wheeled.jpg', '2016-05-05 22:41:20', '194-prolimit-kitesurf-golf-aero-wheeled', 1),
