(50, 906, 2, '2016 Prolimit Sport Twintip', 42, 'Šis maišas skirtas kasdieniam naudojimui. Telpa viena lenta su padukais, kyliukais ir kojakilpėmis. Maišas pasiūtas iš 600D polyester Durable. Maiše įsiūtas nerūdyjančio plieno užtrauktukas.', 'http://www.xpro.lt/1191-tm_thickbox_default/prolimit-bb-sport-tt.jpg', '2016-05-05 22:41:37', '33-prolimit-bb-sport-tt', 1),
