(53, 910, 2, 'Aquapac 098', 28, 'Vandens nepraleidžiantis dėklas telefonui. Pagal dydį tinkamas Iphone 1-4 modeliams ar kitiems panašaus dydžio telefonams. Apsaugos jūsų telefoną, net  5m gylyje. Dėklas netrukdo kalbėtis, fotografuoti  ir naudotis visomis kitomis telefono funkcijomis. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/452-tm_thickbox_default/aquapac-348.jpg', '2016-05-05 22:42:06', '206-aquapac-348', 1),
(54, 911, 2, 'Aquapac 108', 28, 'Vandens nepraleidžiantis dėklas telefonui. Pagal dydį tinkamas vidutinio dydžio telefonams, tokiems kaip iPhone 5c, iPhone 5s ar iPhone 6. Apsaugos jūsų telefoną, net  5m gylyje. Dėklas netrukdo kalbėtis, fotografuoti  ir naudotis visomis kitomis telefono funkcijomis. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/592-tm_thickbox_default/aquapac-348.jpg', '2016-05-05 22:42:14', '303-aquapac-348', 1),
