(107, 965, 2, '2016 Fanatic Hawk Bamboo', 1, 'Greita ir manevringa burlentė pažengusiam buriuotojui. Posūkiai glise, neribotas greitis ir daug adrenalino. \r\nDaugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1417-tm_thickbox_default/2012-fanatic-quad-gds-81l.jpg', '2016-05-05 22:47:28', '324-2012-fanatic-quad-gds-81l', 1),
