(109, 967, 2, '2016 Fanatic Quad TE', 2, 'Jeigu buriavimas bangose yra jūsų aistra, tai ši burlentė jums.  Ši burlentė jau kelis metus yra pekamiausias wave modelis. Daugiau informacijos rasite gamintojųtinklapyje.', 'http://www.xpro.lt/1409-tm_thickbox_default/2012-fanatic-quad-gds-81l.jpg', '2016-05-05 22:47:39', '320-2012-fanatic-quad-gds-81l', 1),
