(111, 969, 2, '2016 Fanatic Skate TE', 2, 'Su šia burlente buriuoja pasaulio čempionas. Jinai daro viską - anksti glisuoja, lengvai šoka, tiksliai sukasi, greitai įsibėgėja. Jinai moka visus triukus. Tau belieka daryti show ir paieškoti kas tave fotografuos ir filmuos krante  :)\r\nDaugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1411-tm_thickbox_default/2012-fanatic-quad-gds-81l.jpg', '2016-05-05 22:47:51', '321-2012-fanatic-quad-gds-81l', 1),
(112, 970, 2, '2016 Fanatic Stubby TE', 2, 'Visiškai nauja burlentė Fanatic linijoje. Ilgai testuota ir tobulinta. Šis naujas konceptas nustebins jus savo kompaktiškumu, greičiu, glisavimo stabilumu ir lengvumu darant manevrus. Ši burlentė skirta pažengusiam buriuotojui buriuoti jūroje. Su ja puikiai jausitės bangose.\r\nInnegra Carbon Light Finish konstrukcija. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1407-tm_thickbox_default/2012-fanatic-quad-gds-81l.jpg', '2016-05-05 22:47:57', '319-2012-fanatic-quad-gds-81l', 1),
(113, 971, 2, '2016 JP All Ride FWS', 2, 'Labai universali burlentė. Ji yra viduriukas tarp JP Freestyle wave ir Supersport modelių. Greita ir  manevringa. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1430-tm_thickbox_default/2015-jp-x-cite-ride-plus-es.jpg', '2016-05-05 22:48:02', '334-2015-jp-x-cite-ride-plus-es', 1),
