(115, 973, 2, '2016 JP Freestyle PRO', 2, 'Su šia burlente buriuoja pasaulio čempionas. Jinai daro viską - anksti glisuoja, lengvai šoka, tiksliai sukasi, greitai įsibėgėja. Jinai moka visus triukus. Tau belieka daryti show ir paieškoti kas tave fotografuos ir filmuos krante  :)\r\n Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1428-tm_thickbox_default/2015-jp-x-cite-ride-plus-es.jpg', '2016-05-05 22:48:14', '332-2015-jp-x-cite-ride-plus-es', 1),
(116, 974, 2, '2016 JP Freestyle wave FWS', 2, 'Labai universali burlentė mėgstantiems buriuoti įvairiomis sąlygomis. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1427-tm_thickbox_default/2015-jp-x-cite-ride-plus-es.jpg', '2016-05-05 22:48:20', '331-2015-jp-x-cite-ride-plus-es', 1),
