(119, 977, 2, '2016 JP X-Cite Ride Plus ES', 1, 'JP Australia X Cite ride Plus jau tapo etalonu burlentės skirtos komfortiškam ir sportiškam buriavimui. 2015 metų modelis net dar labiau sportiškesnis ir greitesnis. Daugiau informacijos apie šią burlentę galite rasti gamintojų tinklapyje.\r\n Su šia burlente lengva buriuoti. Puikus manevringumas ir lengvumo jausmas plaukiant. Burlente išformuota taip, kad turetų didesnį glisavimo paviršių. Tai leidžia labai anksti išglisuoti, o tai pat didesnį stabilumą darant prišvėjinį posukį arba plaukiant len', 'http://www.xpro.lt/1436-tm_thickbox_default/2015-jp-x-cite-ride-plus-es.jpg', '2016-05-05 22:48:42', '687-2015-jp-x-cite-ride-plus-es', 1),
