(122, 980, 2, '2016 Neilpryde Combat', 821, 'Ši legendinė burė puikiai atlieka savo darbą įvairiusiomis bangų sąlygomis. Aukščiausios kokybės burė kurią naudoja geriausi buriuotojai. Daugiau informacijos apie ją rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1386-tm_thickbox_default/2015-neilpryde-combat.jpg', '2016-05-05 22:48:59', '355-2015-neilpryde-combat', 1),
(123, 981, 2, '2016 Neilpryde Combat HD', 857, 'Ši legendinė burė puikiai atlieka savo darbą įvairiusiomis bangų sąlygomis. Aukščiausios kokybės burė kurią naudoja geriausi buriuotojai. HD modelis turi papildomą plėvelės armavimą. Daugiau informacijos apie ją rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1387-tm_thickbox_default/2015-neilpryde-combat.jpg', '2016-05-05 22:49:06', '356-2015-neilpryde-combat', 1);
