(299, 1157, 2, '2015/2016 GNU Carbon Credit ', 280, 'Nuolat apdovanojimus gaunanti snieglentė. Šiemet ji tai pat pripažinta kaip geriausia ir gavusi prestižinį Good wood apdovanojimą. Labai universali, lengvai valdoma ir komfortiška snieglentė tinkama įvairaus lygio snieglentininkams pagaminta Amerikoje.  Snieglentė turi BTX ir Magne traction technologijas, kurios suteikia  neįtikėtiną sukibimą su apledėjusia trasa, stebuklingai slysta puriu sniegu, lengvai įveikia turėklus ir dėžes. Carbon credit - tai viskas ko tau reikia, kad progresuotum nuo p', 'http://www.xpro.lt/933-tm_thickbox_default/20142015-gnu-carbon-credit.jpg', '2016-05-05 23:05:12', '35-20142015-gnu-carbon-credit', 1),
(300, 1158, 2, '2015/2016 GNU Carbon Credit Club', 280, 'Nuolat apdovanojimus gaunanti snieglentė. Šiemet ji tai pat pripažinta kaip geriausia ir gavusi prestižinį Good wood apdovanojimą. Labai universali, lengvai valdoma ir komfortiška snieglentė tinkama įvairaus lygio snieglentininkams pagaminta Amerikoje.  Snieglentė turi BTX ir Magne traction technologijas, kurios suteikia  neįtikėtiną sukibimą su apledėjusia trasa, stebuklingai slysta puriu sniegu, lengvai įveikia turėklus ir dėžes. Carbon credit - tai viskas ko tau reikia, kad progresuotum nuo p', 'http://www.xpro.lt/935-tm_thickbox_default/20142015-gnu-carbon-credit.jpg', '2016-05-05 23:05:18', '470-20142015-gnu-carbon-credit', 1),
