(302, 1160, 2, '2015/2016 GNU Ladies Choice', 392, 'Olimpinės čempionės Jamie Anderson snieglentė, aukščiausio lygio varžybose ne kartą įrodžiusi savo pranašumą. Joje yra sudėtos visos pažangiausios GNU gamybos technologijos ir sprendimai t.y. Pickle, EC2BTX, Magne Traction. Daugiau informacijos apie šią snieglentę galite rasti gamintojų tinklapyje. \r\n\r\n\r\n\r\nEC2 BTX\r\nSnieglentės išgaubimas tarp pėdų kombinacijoje su elipsės formos atvirkštiniu išlenkimu snieglentės galuose. Tai yra viduriukas tarp BTX ir C2BTX technologijų.\r\n\r\n\r\n\r\nMagne-Traction\r\n', 'http://www.xpro.lt/941-tm_thickbox_default/20142015-gnu-ladies-choice.jpg', '2016-05-05 23:05:29', '57-20142015-gnu-ladies-choice', 1),
(303, 1161, 2, '2015/2016 GNU Ladies Gateway', 308, 'Visos kliūtys parke su šia snieglente tampa  daug lengviau įveikiamos. Todėl, kad ji sukurta būtent tam! Daugiau informacijos rasite gamintojų tinklapyje.\r\n\r\n\r\nBTX\r\nIšgaubimas snieglentės dalyje tarp pėdų kombinuojamas su lygiais ir vidutiniškai į priešingą pusę išlenktais lentos galais.\r\n\r\n\r\nMagne-Traction\r\nBanguotas kantas suteikia neįtikėtiną sukibimą, darant posūkius kietoje arba net apledėjusioje trasoje.\r\n\r\n\r\nTwin\r\nLenta yra simetriška.\r\n\r\n\r\nKonstrukcija\r\nPagaminta Amerikoje.', 'http://www.xpro.lt/940-tm_thickbox_default/20142015-gnu-ladies-gateway.jpg', '2016-05-05 23:05:34', '53-20142015-gnu-ladies-gateway', 1),
(304, 1162, 2, '2015/2016 GNU Metal Gnuru', 315, 'Labai universali snieglentė su kuria užtikrintai jautiesi visur: lėkdamas trasomis, atidirbinėdamas triukus parke ar skrisdamas puriame sniege. Daugiau informacijos rasite gamintojų tinklapyje.\r\n\r\n\r\n \r\n\r\nEC2 BTX\r\nSnieglentės išgaubimas tarp pėdų kombinacijoje su elipsės formos atvirkštiniu išlenkimu snieglentės galuose. Tai yra viduriukas tarp BTX ir C2BTX technologijų.\r\n\r\n\r\n\r\nMagne-Traction\r\n\r\nBanguotas kantas suteikia neįtikėtiną sukibimą, darant posūkius kietoje arba net apledėjusioje trasoje', 'http://www.xpro.lt/936-tm_thickbox_default/20142015-gnu-carbon-credit.jpg', '2016-05-05 23:05:40', '44-20142015-gnu-carbon-credit', 1),
