(307, 1165, 2, '2015/2016 Lib Tech Attack Banana', 406, 'Ypatingai universali snieglentė. Jinai daro viską. Joje pritaikyta EC2 BTX technologija, o tai yra viduriukas tarp minkštesnės BTX ir kietesnės C2BTX lentos. Jūs pamilsite šią lentą, nes jinai puikiai jaučiasi snieglenčių parke ir tuo pačiu pakankamai stabili greityje, auštuose šuoliuose ir nusileidimuose. Puriame sniege su ja slysti vienas malonumas. Daugiau informacijos galite rasti gamintojų tinklapyje.\r\n\r\n \r\n\r\nEC2 BTX: Elliptical Camber / Banana Blend\r\nTai yra viduriukas tarp minkštesnės BTX', 'http://www.xpro.lt/945-tm_thickbox_default/20142015-lib-tech-attack-banana.jpg', '2016-05-05 23:05:55', '50-20142015-lib-tech-attack-banana', 1),
(308, 1166, 2, '2015/2016 Lib Tech Skate Banana', 343, 'Smagi, lengvai valdoma, neturinti ribų snieglentė. Purus sniegas, turėklai ir dėžės, trasos ar ledas - viskas su ja įveikiama be pastangų. Puikiai tika pradinukams ir dažnai pasirenkama profesionalų (kaip Jason Robinson ar Sammy Luebke) kai smagumas yra prioritetas Nr1. Daugiau informacijos rasite gamintojų tinklapyje.\r\n\r\n\r\nTechnologijos\r\n\r\n \r\n\r\nBTX: Banana\r\nIšgaubimas snieglentės dalyje tarp pėdų kombinuojamas su lygiais ir vidutiniškai į priešingą pusę išlenktais lentos galais.\r\nMagne-Traction', 'http://www.xpro.lt/942-tm_thickbox_default/20142015-lib-tech-skate-banana.jpg', '2016-05-05 23:06:00', '46-20142015-lib-tech-skate-banana', 1),
(309, 1167, 2, '2015/2016 Lib Tech Skate Banana', 343, 'Smagi, lengvai valdoma, neturinti ribų snieglentė. Purus sniegas, turėklai ir dėžės, trasos ar ledas - viskas su ja įveikiama be pastangų. Puikiai tika pradinukams ir dažnai pasirenkama profesionalų (kaip Jason Robinson ar Sammy Luebke) kai smagumas yra prioritetas Nr1. Daugiau informacijos rasite gamintojų tinklapyje.\r\n\r\n\r\nTechnologijos\r\n\r\n \r\n\r\nBTX: Banana\r\nIšgaubimas snieglentės dalyje tarp pėdų kombinuojamas su lygiais ir vidutiniškai į priešingą pusę išlenktais lentos galais.\r\nMagne-Traction', 'http://www.xpro.lt/943-tm_thickbox_default/20142015-lib-tech-skate-banana.jpg', '2016-05-05 23:06:06', '473-20142015-lib-tech-skate-banana', 1),
(310, 1168, 2, '2015/2016 Lib Tech Skunk Ape', 392, 'Ši snieglentė sukurta aukštaūgiams - sunkiasvoriams snieglentininkams. Su ja jūs galite ramūs, ji nepaves jūsų greitoje trąsoje ir atlaikys didžiausias apkrovas. Daugiau informacijos rasite gamintojų tinklapyje.\r\n\r\nTechnologija\r\n\r\n \r\n\r\nC2 BTX: Power Banana Camber / Banana Blend\r\nMūsų populiariausia technologija , kurią renkasi agresyvūs greitį ir jėgą mėgstantys sportininkai. Standūs snieglentės galai kombinacijoje su vidutiniu standumu viduryje. Aukštiems šuoliams, greičiams, geram sukibimui.\r\n', 'http://www.xpro.lt/949-tm_thickbox_default/20142015-lib-tech-banana-magic-hp.jpg', '2016-05-05 23:06:12', '51-20142015-lib-tech-banana-magic-hp', 1),
