(312, 1170, 2, '2015/2016 Lib Tech TRS', 392, 'Daugybė apdovanojimų gavusi snieglentė, viena iš mėgstamiausių LibTech teamraiderių. Rekomenduojama radikaliems sportininkams mėgstantiems agresyvų čiuožimą, didelius greičius, aukštus tramplynus. Jinai leis spustelti savo fizines ir kūribines jėgas į neregėtas aukštumas. Daugiau informacijos galite rasti gamintojų tinklapyje.\r\n\r\n\r\nTechnologijos\r\nXC2 BTX: Power Banana / Camber Blend\r\nTrupesnis, bet didesnis įlinkis tarp pėdų kombinacijoje su atvirkštiniu lenkimu, kurie patraukti labiau link cent', 'http://www.xpro.lt/947-tm_thickbox_default/20142015-lib-tech-trs.jpg', '2016-05-05 23:06:21', '48-20142015-lib-tech-trs', 1),
