(322, 1180, 2, 'ICETOOLS apsauga Knee Pad', 18, 'Lengva apsauga keliams. Apsaugo nuo šalčio ir sutrenkimų. Nevaržo judesių. Pasiūta iš kvėpuojančios medžiagos. Daugiau informacijos gamintojų tinklapyje.', 'http://www.xpro.lt/1059-tm_thickbox_default/icetools-apsauga-knee-guard.jpg', '2016-05-05 23:07:16', '518-icetools-apsauga-knee-guard', 1),
