(324, 1182, 2, 'ICETOOLS apsauga S-Lite Jr.', 45, 'Lenga  apsauga jūsų nugarai. Labai ergonomiška ir patogi. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1092-tm_thickbox_default/icetools-apsauga-back-belt-std.jpg', '2016-05-05 23:07:26', '543-icetools-apsauga-back-belt-std', 1),
(325, 1183, 2, 'ICETOOLS apsauga S-Lite Lady', 78, 'Lenga  apsauga jūsų nugarai. Labai ergonomiška ir patogi. Daugiau informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1089-tm_thickbox_default/icetools-apsauga-back-belt-std.jpg', '2016-05-05 23:07:30', '541-icetools-apsauga-back-belt-std', 1),
