(327, 1185, 2, 'ICETOOLS šortai Armor', 42, 'Komfortiški, kokybiški šortai skirti apsaugoti sportininko uodegikaulį, klubus ir šlaunis. Teisingai išdėstytos polipropileno plokštelės puikiai atlieka savo funkciją. Šortų medžiaga - kvėpuojantis tinklelis. Yra įsiūti papildomi paminkštinimai.\r\nDaugiau informacijos gamintojų tinklapyje.', 'http://www.xpro.lt/138-tm_thickbox_default/icetools-sortai-armor.jpg', '2016-05-05 23:07:41', '38-icetools-sortai-armor', 1),
(328, 1186, 2, 'ICETOOLS šortai Underpants ', 36, 'Labai lengvi apsauginiai šortai. Paminkštinimai ant uodegikaulio dubens kaulų ir šlaunų. Visiškai nevaržo judesių. Pasiūti iš tamprios medžiagos. Daugiu informacijos rasite gamintojų tinklapyje.', 'http://www.xpro.lt/1058-tm_thickbox_default/icetools-sortai-underpants-lady.jpg', '2016-05-05 23:07:45', '517-icetools-sortai-underpants-lady', 1);
